Қолданба бірнеше ай бойы пайдаланылмаса:

• деректерді қорғау үшін рұқсаттар өшіріледі;
• батарея үнемдеу үшін хабарландырулар тоқтатылады;
• орын босату үшін уақытша файлдар өшіріледі.

Рұқсаттар мен хабарландыруларды қайта пайдалану үшін қолданбаны ашыңыз.

Телефоныңыз іске қосылмады.
Сізге таратылым аумағы жақсырақ орын табу қажет (терезенің жаны немесе сыртта). 

)Қайта әрекеттеніңіз немесе басқа опциялар үшін тұтынушыға қызмет көрсету бөліміне хабарласаңыз.
